import React from "react";
import { Modal } from "react-bootstrap";
import colors from "../../config/colors";

function DoneComponent(props) {
  return (
    <Modal
      {...props}
      dialogClassName="modal-w"
      style={{
        border: "none",
        borderRadius: "50%",
      }}
      centered
    >
      <img
        src={props.data.img}
        attr="status"
        style={{
          width: "100%",
          height: "100%",
          backgroundColor: colors.secondary2,
          border: "none",
          borderRadius: "20px",
        }}
      />
      {props.error.isError === true ? (
        <span
          style={{ fontSize: "1em", color: colors.primary2, fontWeight: 600 }}
        >
          {props.error.error}
        </span>
      ) : null}
    </Modal>
  );
}

export default DoneComponent;
